import React from "react";

function Calculator() {
  // Crear un array del 1 al 9
  const numeros = [1, 2, 3, 4, 5, 6, 7, 8, 9];

  const listaNumeros = numeros.map((numero) => (
    <div className="number" key={numero}>
      {numero}
    </div>
  ));

  const simbolos = ["%", "x", "+", "-", "="];
  const listaSimbolos = simbolos.map((simbolo) => (
    <div className="simbolo" key={simbolo}>
      {simbolo}
    </div>
  ));

  return (
    <div className="calculator">
      <div className="numbers">{listaNumeros}</div>
      <div className="simbolos">{listaSimbolos}</div>
      <div className="resultado">Resultado</div>
    </div>
  );
}

export default Calculator;
